import React, { useState } from "react";
import axios from "axios";

function DataTable() {
  const [responseData, setResponseData] = useState([]);

  const fetchData = async () => {
    try {
      const response = await axios.get("http://localhost:3000/report-page");
      setResponseData(response.data);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  return (
    <div>
      <button onClick={fetchData}>Veriyi Getir</button>
      <table>
        <thead>
          <tr>
            <th>Key</th>
            <th>Value</th>
          </tr>
        </thead>
        <tbody>
          {responseData.map((item, index) => (
            <tr key={index}>
              <td>{item.key}</td>
              <td>{item.value}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default DataTable;
